import './Middel.css'
import { UilUserExclamation } from '@iconscout/react-unicons'
import React from 'react';


const Middel = () => {
    return (
    <div className="MainMiddel">
        <div className='BigBox'>
            <div className='Col-B1'>
                <div className='iconabout'><UilUserExclamation/></div>
                <div className='infotext'></div>
            </div>
            <div className='Col-B2'></div>
            <div className='Col-B3'></div>

        </div>
    </div>
    );
}
 
export default Middel;
